import { View, Text, StyleSheet, Button } from 'react-native'
import React from 'react'
import { config } from '@gluestack-ui/config'
import { GluestackUIProvider, Box, Heading, HStack, ScrollView } from '@gluestack-ui/themed'
import MusicCard from '../components/MusicCard'

export default function Home({ navigation }) {
    return (
        <GluestackUIProvider config={config}>

            <View style={{ flex: 1, backgroundColor: '#1f1f1f', paddingLeft: 5, paddingRight: 5, }}>
                <Heading style={styles.light} size='2xl'>Musics</Heading>
                {/* <Text style={styles.light}>Hellow</Text> */}


                <ScrollView horizontal={true} marginLeft={5} marginRight={5} marginTop={30}>
                    {/* <MusicCard txt="Aaaa" style={styles.light} /> */}
                    <HStack space="sm" flex={1}>
                        <MusicCard txt="Aaaa" style={styles.light} />
                    </HStack>
                </ScrollView>

                <Heading style={styles.light} size='2xl'>Musics</Heading>

            </View>

        </GluestackUIProvider>
    )
}

const styles = StyleSheet.create({
    light: {
        // backgroundColor: myColors.light,
        color: '#eaf8ff',
    },
    dark: {
        color: '#1f1f1f',
    },

});
